import { useParams } from "react-router-dom";
import Header from "../components/Header";
import { annonces } from "../components/card";
function AnnoncePage() {
  const { id } = useParams();
  const infoAnnonce = annonces.find((annonce) => annonce.id === id);
  return (
    <>
      <Header />
      <main>
        <article>
          <img src={infoAnnonce.cover} alt="dddd" />
        </article>
      </main>
    </>
  );
}
export default AnnoncePage;
